import PortfolioCard from '../PortfolioCard';


const projects = [
  {
      title: 'Fresh Food',
      description: 'Site de vente de produit frais en ligne.',
      image: '../Images/portfolio/fresh-food.jpg',
      link: '#',
      techno:'Site réalisé avec PHP et MySQL'
  },
  {
      title: 'Projet 2',
      description: 'Site de vente de produit frais en ligne.',
      image: 'project2.jpg',
      link: '#',
      techno:'Site réalisé avec PHP et MySQL'

  },
  {
      title: 'Projet 3',
      description: 'Site de vente de produit frais en ligne.',
      image: 'project3.jpg',
      link: '#',
      techno:'Site réalisé avec PHP et MySQL'

  },
  {
      title: 'Projet 4',
      description: "Amélioration de référencement d'un site e-commerce.",
      image: 'project4.jpg',
      link: '#',
      techno:'Site réalisé avec PHP et MySQL'

  },
  {
      title: 'Projet 5',
      description: "Création d'une API RESTFULL publique",
      image: 'project5.jpg',
      link: '#',
      techno:'Site réalisé avec PHP et MySQL'

  },
  {
      title: 'Projet 6',
      description: "Création du prototype d'un site",
      image: 'project6.jpg',
      link: '#',
      techno:'Site réalisé avec PHP et MySQL'

  },
];

const PorteFolio = () => {
  return (
    <>

    
    <div>
      <h1>Porte Folio</h1>
    </div>
    <div className="container my-5">
            <div className="row g-4">
                {projects.map((project, index) => (
                    <PortfolioCard
                        key={index}
                        title={project.title}
                        description={project.description}
                        image={project.image}
                        link={project.link}
                        techno={project.techno}
                    />
                ))}
            </div>
        </div>

   
    
    
    </>
    
  )
  }
  
  export default PorteFolio;
